import React from "react";
import { Link } from "react-router-dom";
import Section from "../components/UI/Section";
import SectionDivider from "../components/UI/SectionDivider";
import { motion } from "framer-motion";
import DueDateCountdown from "../components/DueDateCountdown";

const Home = () => {
  return (
    <div className="min-h-screen bg-white font-sans">
      {/* Hero Section */}
      <Section center tightTop compact>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
          className="relative overflow-hidden rounded-[2.5rem] bg-babyPink/30 px-6 py-16 text-center shadow-md"
        >
          {/* Title */}
          <motion.h1
            initial={{ opacity: 0, y: 24, scale: 0.98 }}
            animate={{ opacity: 1, y: 0, scale: [0.98, 1.03, 1] }}
            transition={{ duration: 0.55, ease: "easeOut" }}
            className="mb-4 text-center font-cursive leading-tight text-babyBlue text-4xl sm:text-5xl tracking-tight"
          >
            <motion.span
              initial={{ opacity: 0, y: 12 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, ease: "easeOut", delay: 0.1 }}
className="font-cursive text-6xl sm:text-[4rem] inline-block mr-2 text-babyBlue"            >
              Taylor-Made
            </motion.span>
            <motion.span className="font-cursive text-babyBlue">
              Baby Planning
            </motion.span>
          </motion.h1>

          {/* Subtitle */}
          <p className="font-sans text-lg md:text-xl text-black/70 max-w-2xl mx-auto">
            A calm, confident path to welcoming your little one. Personalized
            registries, nursery design, shower planning, and ongoing
            supportâ€”tailored to your family.
          </p>

          {/* Hero image */}
          <motion.img
            src="/assets/hero-baby.png"
            alt="Baby Planning Illustration"
            className="mx-auto mt-6 max-w-md drop-shadow-lg animate-float"
            initial={{ opacity: 0, scale: 0.95 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.8, ease: "easeOut", delay: 0.3 }}
          />

          {/* Buttons */}
          <div className="mt-8 flex flex-wrap justify-center gap-4">
            <Link
              to="/services"
              className="px-8 py-3 rounded-full bg-gradient-to-r from-babyPink to-babyBlue text-white font-sans font-semibold shadow-md hover:opacity-90 transition"
            >
              Explore Services
            </Link>
            <Link
              to="/contact"
              className="px-8 py-3 rounded-full border border-babyBlue/40 bg-white text-black font-sans font-medium tracking-wide transition hover:bg-babyPink/20 hover:shadow-md"
            >
              Book a Consultation
            </Link>
          </div>

          {/* Features */}
          <div className="mt-10 grid gap-6 text-left text-black/80 md:grid-cols-3">
            {[
              {
                icon: "ðŸ¼",
                label: "Invite-Only",
                detail: "A discreet client list curated by referral.",
              },
              {
                icon: "ðŸ§¸",
                label: "Concierge Care",
                detail: "Taylor personally oversees every decision.",
              },
              {
                icon: "ðŸ‘¶",
                label: "Confidential Always",
                detail: "NDA-backed planning and event management.",
              },
            ].map(({ icon, label, detail }, index) => (
              <motion.div
                key={label}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.2 + index * 0.15 }}
                className="rounded-2xl border border-babyBlue/30 bg-babyPink/20 px-5 py-4 shadow-sm hover:bg-babyBlue/20 transition"
              >
                <div className="text-3xl">{icon}</div>
                <p className="mt-3 font-cursive text-lg text-black">{label}</p>
                <p className="text-sm font-sans text-black/70">{detail}</p>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </Section>

      {/* Countdown Section */}
      <Section
        title="Countdown to Baby Day ðŸŽ‰"
        center
        className="bg-babyBlue/20 rounded-3xl"
      >
        <DueDateCountdown dueDate="2025-12-01" />
      </Section>

      <SectionDivider className="my-6" />

      {/* Services Section */}
      <Section
        title="Services Snapshot â€” Taylor-Made for You"
        tightTop
        compact
        className="bg-pastelGreen/20 rounded-3xl"
      >
        <div className="px-6 py-6">
          <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
            {[
              {
                title: "Registry Concierge",
                desc: "Curated lists, managed & delivered.",
                icon: "ðŸ—’ï¸",
              },
              {
                title: "Personal Shopping",
                desc: "VIP access & white-glove delivery.",
                icon: "ðŸ›ï¸",
              },
              {
                title: "Nursery Design",
                desc: "Safety + styling planned seamlessly.",
                icon: "ðŸ›ï¸",
              },
              {
                title: "Events & Celebrations",
                desc: "Baby showers, sip-and-sees.",
                icon: "ðŸ¥‚",
              },
              {
                title: "Family Integration",
                desc: "Support for siblings & pets.",
                icon: "ðŸ‘¨â€ðŸ‘©â€ðŸ‘§â€ðŸ‘¦",
              },
              {
                title: "Ongoing Concierge",
                desc: "Postpartum coaching & more.",
                icon: "â³",
              },
            ].map((service, index) => (
              <motion.div
                whileHover={{ scale: 1.05, y: -2 }}
                initial={{ opacity: 0, y: 15 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.3, delay: index * 0.1 }}
                key={service.title}
                className="rounded-2xl border border-babyBlue/30 bg-white/90 px-5 py-6 shadow-sm hover:bg-pastelPurple/20 transition"
              >
                <div className="text-3xl">{service.icon}</div>
                <h3 className="mt-3 font-cursive text-xl text-black">
                  {service.title}
                </h3>
                <p className="mt-2 text-sm font-sans text-black/70 leading-relaxed">
                  {service.desc}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </Section>

      <SectionDivider className="my-6" />
    </div>
  );
};

export default Home;
